import styles from './'

export function SideBar({busRoutes, getBusRouteUser})  {
  return(
    <div class="side-bar">
      <header>
        <h2>Bus Routes</h2>
      </header>

      {busRoutes.map((busRoute, index) => 
        <button onClick={() => getBusRouteUser(index+1)}>{busRoute.name}</button>
      )}
    </div>
  )
}
